import React from "react";

import LanguageNode from "../components/repository/LanguageNode";
import "../components/repository/RepositoryItem.scss";

const ListItem = ({ repository }) => {
  return (
    <div className="repository-item">
      <div className="repository-item__header">
        <a
          href={repository.url}
          target="_blank"
          className="repository-item__header__repo-name"
        >
          {repository.name}
        </a>
      </div>
      <div className="repository-item__content">
        <p>{repository.description}</p>
      </div>

    </div>
  );
};

export default ListItem;
